contracts/Aggregator.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import {IERC20} from "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import {ERC20} from "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import {IDexHandlerFactory} from "./interfaces/IDexHandlerFactory.sol";
import {IAggregatorExecutor} from "./interfaces/IAggregatorExecutor.sol";
import {SwapMultiHop, SwapDescription} from "./structs/SAggregator.sol";
import {Address} from "./libraries/Address.sol";
import {SafeERC20} from "./libraries/SafeERC20.sol";
import {UniERC20} from "./libraries/UniERC20.sol";

contract Aggregator {
    using Address for address;
    using SafeERC20 for IERC20;
    using UniERC20 for IERC20;

    uint256 private constant _PARTIAL_FILL = 0x01;
    uint256 private constant _REQUIRES_EXTRA_ETH = 0x02;
    uint256 private constant _SHOULD_CLAIM = 0x04;
    uint256 private constant _BURN_FROM_MSG_SENDER = 0x08;
    uint256 private constant _BURN_FROM_TX_ORIGIN = 0x10;

    IDexHandlerFactory public factory;
    address public owner;

    address public immutable WETH;
    address private constant ETH_ADDRESS =
        address(0xEeeeeEeeeEeEeeEeEeEeeEEEeeeeEeeeeeeeEEeE);

    struct SwapStep {
        address router;
        address tokenIn;
        address tokenOut;
        uint8 dexType;
        uint24 fee; // only for V3
    } // optimize struct storage slots

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner");
        _;
    }

    constructor(address _factory) {
        require(_factory != address(0), "Invalid factory address");
        factory = IDexHandlerFactory(_factory);
        owner = msg.sender;
    }

    receive() external payable {}

    // function getBalance(IERC20 token, address account) internal view returns(uint256) {
    //     token.uniBalanceOf(account);
    // }

    // function isETH(IERC20 token) internal view returns (bool iseth) {
    //     iseth = token.isETH();
    // }

    function flexSwap(
        IAggregatorExecutor executor,
        SwapMultiHop calldata params,
        SwapDescription calldata desc
    ) external returns(uint256 amountOut) {
        bytes memory result = address(this).functionDelegateCall(abi.encodeWithSelector(this.swap.selector, executor, params, desc));
        uint256 returnAmount = abi.decode(result, (uint256));
    }

    function swap(
        IAggregatorExecutor executor,
        SwapMultiHop calldata params,
        SwapDescription calldata desc
    ) external returns(uint256 amountOut) {
        uint256 flag = desc.flags;
        IERC20 tokenIn = IERC20(desc.tokenIn);
        IERC20 tokenOut = IERC20(desc.tokenOut);
        tokenIn.transferFrom(msg.sender, address(this), desc.amountIn);
        tokenIn.uniApprove(address(executor), desc.amountIn);
        uint256 balanceSrcBefore = tokenIn.uniBalanceOf(msg.sender);
        require(balanceSrcBefore > 0, "No higher than 0");
        uint256 balanceDstBefore = tokenOut.uniBalanceOf(msg.sender);
        amountOut = executor.swapMultiHop(params, desc, factory);
        uint256 balanceSrcAfter = tokenIn.uniBalanceOf(msg.sender);
        uint256 balanceDstAfter = tokenOut.uniBalanceOf(msg.sender);

        uint256 spentAmount = balanceSrcBefore - balanceSrcAfter;
        uint256 returnAmount = balanceDstAfter - balanceDstBefore;
        amountOut = returnAmount;
        _checkReturnAmount(spentAmount, returnAmount, desc);
    }

    function _checkReturnAmount(
    uint256 spentAmount,
    uint256 returnAmount,
    SwapDescription memory desc
  ) internal pure {
    if (_flagsChecked(desc.flags, _PARTIAL_FILL)) {
      require(returnAmount * desc.amountIn >= desc.minReturnAmount * spentAmount, 'Return amount is not enough');
    } else {
      require(returnAmount >= desc.minReturnAmount, 'Return amount is not enough');
    }
  }

    function _flagsChecked(uint256 number, uint256 flag) internal pure returns (bool) {
        return number & flag != 0;
    }
}

contracts/AggregatorExecutor.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import {IERC20} from "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import {ERC20} from "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import {IDexHandlerFactory} from "./interfaces/IDexHandlerFactory.sol";
import {SwapMultiHop, SwapDescription} from "./structs/SAggregator.sol";
import {Address} from "./libraries/Address.sol";
import {SafeERC20} from "./libraries/SafeERC20.sol";
import {UniERC20} from "./libraries/UniERC20.sol";

contract AggregatorExecutor {
    using Address for address;
    
    function swapMultiHop(
        SwapMultiHop calldata params,
        SwapDescription calldata desc,
        IDexHandlerFactory factory
    ) external returns(uint256 amountOut) {
        require(desc.amountIn != 0, "The amount for swap is zero");
        address dexHandler;
        uint256 amountIn = desc.amountIn;

        IERC20(desc.tokenIn).transferFrom(msg.sender, address(this), desc.amountIn);

        for (uint8 i = 0; i < params.routers.length; i++) {
            address _tokenIn = params.tokenIn[i];
            dexHandler = factory.dexHandlers(params.dexHandlerIds[i]);
            IERC20(_tokenIn).approve(params.routers[i], amountIn);
            bytes memory result = address(dexHandler).functionDelegateCall(abi.encodeWithSignature("executeSwap(address,bytes)", params.routers[i], params.data[i]));
            amountOut = abi.decode(result, (uint256));
            amountIn = amountOut;
        }
    }
}

contracts/DexHandlerFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import {IDexHandlerFactory} from "./interfaces/IDexHandlerFactory.sol";

contract DexHandlerFactory is IDexHandlerFactory{
    mapping(uint8 => address) public dexHandlers;
    address public owner;
    uint8 public id;

    modifier onlyOwner {
        require(msg.sender == owner, "Only owner");
        _;
    }
    
    constructor() {
        owner = msg.sender;
    }

    function setDexHandler(address dexHandler) external onlyOwner returns(uint8) {
        dexHandlers[id] = dexHandler;
        id++;
    }
}

